######################################################

errorExceptions: 
	csrr 	s11, utval      # le o utval da exce��o e salva em s11	
	addi 	a0, zero, 0xc0 		## printa tela de azul
	addi 	a1, zero, 0
	addi 	a7, zero, 148
	jal 	clsCLS
	
#  Instruction address misaligned 	
End_Cause0:	
	li 	t0, 0
	bne 	t0, s10, End_Cause1
	la 	a0, Cause0
	li 	a1, 0
	li 	a2, 1
	li 	a3, 0x0000c0ff
	jal	printString
	j	End_uepc
	
# Instruction access fault 
End_Cause1:	li 	t0, 1
		bne 	t0, s10, End_Cause2
		la 	a0, Cause1
		li 	a1, 0
		li 	a2, 1
		li 	a3, 0x0000c0ff
		jal 	printString	
		j	End_uepc
			
# Ilegal Instruction 
End_Cause2:	li 	t0, 2
		bne 	t0, s10, End_Cause4
		la 	a0, Cause2
		li 	a1, 0
		li 	a2, 1
		li 	a3, 0x0000c0ff
		jal 	printString
		
		la 	a0, Instr
		j	End_utval
	
# Load address misaligned 
End_Cause4:	addi 	t0, zero, 4
		bne	t0, s10, End_Cause5
		la 	a0, Cause4
		li 	a1, 0
		li 	a2, 1
		li 	a3, 0x0000c0ff
		jal	printString
		
		la 	a0, Addrs
		j	End_utval
		
