loopReadCharKDMMIO:  	lw     	a0, 0(t0)   			# le o bit de flag do teclado
			andi 	a0, a0, 0x0001			# mascara bit 0
			beq     a0, zero, loopReadCharKDMMIO  	# testa se uma tecla foi pressionada
   			lw 	a0, 4(t0)			# le o ascii da tecla pressionada
