###########################################################################################################
directionLoop:	beq s0, s1, endDirectionLoop
		addi s1, s1, 8
		add a0, s4, s1 # endereco de cada ponto
		addi a1, a0, -4
		lw a0, (a0)
		sw a0, (a1)
		addi s1, s1, -4
		j directionLoop
		
endDirectionLoop:	
			#li s6, 250
			jal Sleep
			sw s2, (s3)
			lw ra, 0(sp)
			lw s0, 4(sp)
			lw s1, 8(sp)
			lw s2, 12(sp)
			lw s3, 16(sp)
			addi sp, sp, 20
			ret	

###########################################################################################################
verificaDireita:
	addi sp, sp, -8	# espaco na pilha para registradores salvos e ra
	sw ra, 0(sp)
	sw s0, 4(sp)
	
	jal pegaCabeca
	srli t3, t0, 16 # pega x
	li t1, 0x00000025 # borda direira
	
	bge t3, t1, R1
	blt t3, t1, R2
	R1 : jal LOSE
	R2:	lw ra, 0(sp)
		lw s0, 4(sp)
		addi sp, sp, 8
		ret

###########################################################################################################
verificaEsquerda:
	addi sp, sp, -8	# espaco na pilha para registradores salvos e ra
	sw ra, 0(sp)
	sw s0, 4(sp)
	
	jal pegaCabeca
	srli t3, t0, 16 # pega x
	li t1, 0x00000002 # borda esquerda
	
	ble t3, t1, L1
	bgt t3, t1, L2
	L1 : jal LOSE
	L2:	lw ra, 0(sp)
		lw s0, 4(sp)
		addi sp, sp, 8
		ret
