verificaAcima:
	addi sp, sp, -8	# espaco na pilha para registradores salvos e ra
	sw ra, 0(sp)
	sw s0, 4(sp)
	
	jal pegaCabeca
	li t1, 0x0000FFFF
	and t3, t0, t1
	li t1, 0x00000005 # borda de cima
	
	ble t3, t1, U1
	bgt t3, t1, U2
	U1 : jal LOSE
	U2:	lw ra, 0(sp)
		lw s0, 4(sp)
		addi sp, sp, 8
		ret

