verificaAbaixo:
	addi sp, sp, -8	# espaco na pilha para registradores salvos e ra
	sw ra, 0(sp)
	sw s0, 4(sp)
	
	jal pegaCabeca
	li t1, 0x0000FFFF
	and t3, t0, t1
	li t1, 0x0000001B # borda de baixo
	
	bge t3, t1, D1
	blt t3, t1, D2
	D1 : jal LOSE
	D2:	lw ra, 0(sp)
		lw s0, 4(sp)
		addi sp, sp, 8
		ret	
###########################################################################################################

pegaCabeca:
	addi sp, sp, -4
	sw s0, (sp)
	lw s0, 0(s4) 	# Carrega tamanho da cobra
	slli s0, s0, 2	# Multiplica por 4
	add t0, s4, s0 	# pega o endereco da cabeca da cobra
	lw t0, (t0) 	# Carrega a coordenada
	sw s0, (sp)
	addi sp, sp, 4
	ret

###########################################################################################################
Grow:	jal MusicaComeu
	addi s7, s7 , 7
	li t0, 50
	blt t0, s6, Harder
	ContinueGrow: jal Score
	jal Speed
	lw s0, 0(s4) 	# Carrega tamanho da cobra
	addi s0, s0, 1
	sw s0, 0(s4) 	# Guarda novo tamanho
	
	slli s0, s0, 2	# Multiplica por 4
	add a0, s4, s0 	# pega o endereco da cabeca da cobra
	sw s2, 0(a0)	# Guarda nova cabe�a
	j FinishAfterGrow

###########################################################################################################
FinishAfterGrow:
	#li s6, 250
	jal Sleep
	jal Frutinha
	addi s5, a0, 0 # Endere�o da nova frutinha
	lw ra, 0(sp)
	lw s0, 4(sp)
	lw s1, 8(sp)
	lw s2, 12(sp)
	lw s3, 16(sp)
	addi sp, sp, 20
	ret	
	
###########################################################################################################
VerificaCobra: #Recebe em s2 coordenada da pr�xima cabeca
	
	addi sp, sp, -16	# espaco na pilha para registradores salvos e ra
	sw ra, 0(sp)
	sw s0, 4(sp)
	sw s4, 8(sp)
	sw s5, 12(sp)
	
	addi s0, zero, 0 	# Contador
	addi t1, zero, 0 	# Contador por endereco
	lw s5, 0(s4) 		# Tamanho da cobra
VCL:	beq s0, s5, FimVerificaCobra
	addi t1, t1, 4	# Proximo endereco da cobra
	add t2, t1, s4	# Endereco offset + multiplo de 4 
	lw t2, (t2)	
	beq s2, t2, LOSE
	addi s0, s0, 1
	j VCL

###########################################################################################################
FimVerificaCobra:
	lw ra, 0(sp)
	lw s0, 4(sp)
	lw s4, 8(sp)
	lw s5, 12(sp)
	addi sp, sp, 16
	ret
###########################################################################################################
Harder:
addi s6, s6, -15
addi s9, s9, 1
j ContinueGrow
.text 
LOSE: 	#li s11, 0x00000000
	addi sp, sp, -8
	sw ra, (sp)
	sw s6, (sp)
	jal MusicaPerdeu
	jal PrintLose
	li s6, 3000
	jal Sleep
	lw s6, (sp)
	lw ra, (sp)
	addi sp, sp, 8
	j IniciaJogo
.text

DesenhaCobra:
	addi sp, sp, -16
	sw s4, 0(sp)
	sw s5, 4(sp)
	sw s6, 8(sp)
	sw s10, 12(sp)

	add s10, ra, zero #guarda ra
	lw t0, 0(s4) 	# Carrega tamanho da cobra
	slli s6, t0, 2	# Multiplica por 4
	li s5, 0	# Contador inicia em 0
	#li a1, 0x0000	# cor da cobra
Loop:	beq s5, s6, fimLoop
	addi s5, s5, 4	# incrementa contador
	#slli t2, t1, 2	# multiplica por 4
	add t2, s5, s4 	# guarda endere�o da proxima posicao da cobra
	lw a0, (t2) 	# guarda a proxima posicao
	li a1, 0x0000	# cor da cobra
	jal PontoDireita
	j Loop 
	
fimLoop:	add ra, s10, zero
			lw s4, 0(sp)
			lw s5, 4(sp)
			lw s6, 8(sp)
			lw s10, 12(sp)
			addi sp, sp, 16
			ret
